class FutureSupplier<T> implements Supplier<T>{

    private final Supplier<T> supplier;

    Thread processThread;

    private AtomicBoolean processed;

    public FutureSupplier( Supplier<T> supplier){
        this.supplier = supplier;
        this.processed = new AtomicBoolean(false);
    }

    boolean isProcessed(){
        return processed.get();
    }

    // 任务已开始则等待，否则将异步任务置空，并同步执行任务
    public T getOrRun(){
        // cas
        if(!processed.compareAndSet(false, true)){
            try {
                processThread.join();
            } catch (InterruptedException e) {
                throw new RuntimeException(e);
            }
        }
        return null;
    }

    @Override
    public T get(){
        processThread = Thread.currentThread();
        if(!processed.compareAndSet(false, true)){
            return null;
        }

        try {
            Thread.sleep(10000);
        } catch (InterruptedException e) {
            throw new RuntimeException(e);
        }
        System.out.println("get running:"+Thread.currentThread().getName());

        return supplier.get();
    }

}
